import React, { Component } from 'react';

class SearchBar extends Component {
    state = { 
        text: ''
    }



    render(props) { 
        return ( 
            <div>
                <input 
                    value={this.state.text}
                    onChange={this.handleTextChange}
                />
            </div>
         );
    }
}

export default SearchBar;
